  return (
    <div className='App'>
    <Router>
   <Header />
      <Switch>

          <Route path="/" exact>
            <LoginForm />
          </Route>

          <Route path="/login" exact>
            <LoginForm />
          </Route>

          <Route path="/friends" exact>
